transforms.result:
$vips: (
  '0': #737373,
  '1-3': #654830,
  '4-6': #667090,
  '7-9': #c58a0e,
  '10-12': #4d8747,
  '13-15': #6e58d4,
  '16-18': #c851b1,
  '19-20': #e65a2c
);
